import React from "react";

const Footer = () => {
  const scrollToTop = () => {
    window.scrollTo({ top: 0, behavior: "smooth" });
  };

  return (
    <footer style={{ backgroundColor: "#232f3e", color: "white", marginTop: "20px", fontFamily: "Arial, sans-serif" }}>
      
      <div
        style={{
          backgroundColor: "#37475a",
          textAlign: "center",
          padding: "10px",
          cursor: "pointer",
        }}
        onClick={scrollToTop}
      >
        <p style={{ margin: 0, fontSize: "14px", fontWeight: "bold" }}>Back to top</p>
      </div>

     
      <div
        style={{
          display: "flex",
          flexWrap: "wrap",
          justifyContent: "space-between",
          padding: "20px 50px",
        }}
      >
        <div style={{ flex: 1, margin: "10px", minWidth: "200px" }}>
          <h3 style={{ fontSize: "16px", marginBottom: "10px", color: "#ddd" }}>Get to Know Us</h3>
          <ul style={{ listStyleType: "none", padding: 0 }}>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>About Us</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Careers</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Press Releases</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Amazon Science</li>
          </ul>
        </div>
        <div style={{ flex: 1, margin: "10px", minWidth: "200px" }}>
          <h3 style={{ fontSize: "16px", marginBottom: "10px", color: "#ddd" }}>Make Money with Us</h3>
          <ul style={{ listStyleType: "none", padding: 0 }}>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Sell on Amazon</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Become an Affiliate</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Fulfillment by Amazon</li>
            <li style={{ margin: "5px 0", fontSize: "14px", color: "#bbb", cursor: "pointer" }}>Advertise Your Products</li>
          </ul>
        </div>
      </div>

      
      <div
        style={{
          borderTop: "1px solid #3a4553",
          padding: "20px 50px",
          textAlign: "center",
        }}
      >

        <div style={{ margin: "20px 0" }}>
          <a
            href="#"
            style={{ margin: "0 10px", color: "#bbb", fontSize: "20px", textDecoration: "none" }}
          >
            <i className="fab fa-facebook"></i>
          </a>
          <a
            href="#"
            style={{ margin: "0 10px", color: "#bbb", fontSize: "20px", textDecoration: "none" }}
          >
            <i className="fab fa-twitter"></i>
          </a>
          <a
            href="#"
            style={{ margin: "0 10px", color: "#bbb", fontSize: "20px", textDecoration: "none" }}
          >
            <i className="fab fa-instagram"></i>
          </a>
          <a
            href="#"
            style={{ margin: "0 10px", color: "#bbb", fontSize: "20px", textDecoration: "none" }}
          >
            <i className="fab fa-linkedin"></i>
          </a>
        </div>

        <p style={{ fontSize: "12px", color: "#bbb", marginTop: "10px" }}>
          Â© {new Date().getFullYear()} Infinia. All rights reserved.
        </p>
      </div>
    </footer>
  );
};

export default Footer;
